import React from "react";

const Eat = props => {
  let eats = props.dataString.filter(item => item.type === "eat");
  console.log(eats);
  return (
    <div class="container mb-5">
      <h1 className="text-center  special-font mt-5">To Eat in Ballywole</h1>
      {eats.map(eat => (
        <div class="row mt-5 pt-4">
          <div class="col-sm col-md-4 ">
            <img className="w-100" alt="food" src={eat.image}></img>
          </div>
          <div class="col-sm col-md-8 description">
            <h3>{eat.title}</h3>
            <p>{eat.description}</p>
            <p className="font-italic">{eat.address}</p>
            <a href="wikipedia.com">{eat.website}</a>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Eat;
